import React from "react";
import "./pics.css";
import Cards from "react-bootstrap";
import CardItem from "./CardItem";
export default function Picture() {
  return (
    <div className="cards">
    <div className="cards__container">
      <div className="cards__wrapper">
        <ul className="cards__items">
          <CardItem
            src="ResumePics/masters.jpeg"
            text="Master's in Technology Management"
            label="In Progress"
            path="/Education"
          />
          <CardItem
            src="ResumePics/BS.jpeg"
            text="Bachelor's In Computer Science"
            label="Completed"
            path="/Education"
          />
        </ul>
      </div>
    </div>
  </div>
    // <div className="picHolder">
    //   <div className="image">

    //   </div>
    //   <div className="discr">{/* <h1>Software/Web Deverloper</h1> */}</div>
    // </div>
  );
}
